import './index.css';

ReactDOM.render(
  <>
 <h1> This is list of five netflix series </h1>
 <p>there are following five netflix series</p>
 <ol>  
 <li> thisn first</li>
 <li> thisn second</li>
 <li> thisn three</li>
 <li> thisn four</li>
 <li> thisn five</li>
  </ol>
  </>
